import { Component, Input } from '@angular/core';
import { ToDo } from '../../interfaces/todos.interface';

@Component({
  selector: 'task-lists',
  templateUrl: './list-tasks.component.html'
})
export class TasksListsComponent {

  @Input()
  public todos: ToDo[] = [];
}
